    [],nt"num_tags": 0,nt"name": "effects-of-ocean-acidification-on-phytoplankton-physiology-and-nutrition-for-fishery-based-food7db94",nt"isopen":
    false,nt"url": null,nt"notes": "Rising atmospheric concentrations of CO2
    are predicted to decrease the pH of high-latitude oceans by 0.3u20130.5 units by
    2100. Because of their limited capacity for ion exchange, embryos and larvae of
    marine fishes are predicted to be more sensitive to elevated CO2 than juveniles
    and adults. Eggs and larvae of walleye pollock (Theragra chalcogramma) were incubated
    across a broad range of CO2 levels (280u20132100 matm) to evaluate sensitivity in
    this critical resource species. Slightly elevated CO2 levels ( 450 matm) resulted
    in earlier hatching times, but differences among egg batches were greater than those
    observed across CO2 treatments. Egg batches differed significantly in size-at-hatch
    metrics, but we observed no consistent effect of CO2 level. In three independent
    experiments, walleye pollock were reared at ambient and elevated CO2 levels through
    the early larval stage (to  30 days post-hatch). Across trials, there were only
    minor effects of CO2 level on size and growth rate, but fish in the ambient treatments
    tended to be slightly smaller than fish reared at elevated CO2 levels. These results
    suggest that growth potential of early life stages of walleye pollock is resilient
    with respect to the direct physiological effects of ocean acidification.",nt"owner_org":
